import React, { Component } from 'react'
// import btn_icon_27191 from './images/btn_icon_27191.png';

// UI framework component imports
import Appbar from 'muicss/lib/react/appbar';
import Container from 'muicss/lib/react/container';

export default class Screen1 extends Component {

  // Properties used by this component:
  // appActions, deviceInfo

  constructor(props) {
    super(props);

    this.state = {
    };
  }

  componentDidMount() {
  }

  componentWillUnmount() {
  }

  componentDidUpdate() {
  }

  componentWillReceiveProps(nextProps) {
  }

  onClick_elComp = (ev) => {
    // Go to screen 'Login 1'
    this.props.appActions.goToScreen('login1', { transitionId: 'fadeIn' });

  }


  render() {
    let layoutFlowStyle = {};
    let baseStyle = {};
    if (this.props.transitionId && this.props.transitionId.length > 0 && this.props.atTopOfScreenStack && this.props.transitionForward) {
      baseStyle.animation = '0.25s ease-in-out '+this.props.transitionId;
    }
    if ( !this.props.atTopOfScreenStack) {
      layoutFlowStyle.height = '100vh';
      layoutFlowStyle.overflow = 'hidden';
    }

    const style_elBackground = {
      width: '100%',
      height: '100%',
     };
    const style_elBackground_outer = {
      backgroundColor: '#f6f6f6',
     };
    const style_elHotspot = {
      display: 'block',
      textTransform: 'uppercase',
      backgroundColor: 'transparent',
     };
    const style_elComp = {
      cursor: 'pointer',
      pointerEvents: 'auto',
     };
    const style_elIconButton = {
      display: 'block',
      textTransform: 'uppercase',
      backgroundImage: 'url('+btn_icon_27191+')',
      backgroundRepeat: 'no-repeat',
      backgroundSize: '90.122%',
      backgroundPosition: '50% 0%',
      color: '(null)',
      textAlign: 'left',
      backgroundColor: 'transparent',
     };

    return (
      <Container fluid={true} className="AppScreen Screen1" style={baseStyle}>
        <div className="background">
          <div className="containerMinHeight elBackground" style={style_elBackground_outer}>
            <div className="appBg" style={style_elBackground} />
          </div>
        </div>

        <div className="layoutFlow" style={layoutFlowStyle}>
          <div className="flowRow flowRow_Screen1_elHotspot_66190">
          <div className="elHotspot">
            <div className="actionFont" style={style_elHotspot} />
          </div>

          </div>
        </div>
        <Appbar className="navBar">
          <div className="backBtn" onClick={ (ev)=>{ this.props.appActions.goBack() } }></div>
        </Appbar>

        <div className="screenFgContainer">
          <div className="foreground">
            <div className="hasNestedComps elComp" style={style_elComp} onClick={this.onClick_elComp} >
              {/* <Comp1 ref={(el)=> this._elComp = el} appActions={this.props.appActions} deviceInfo={this.props.deviceInfo} locStrings={this.props.locStrings} /> */}
            </div>
            <button className="actionFont elIconButton" style={style_elIconButton} />
          </div>
        </div>
      </Container>
    )
  }

}
